import React, { useState } from 'react';
import { AppBar, Toolbar, Button, Container, Typography, Grid, Card, CardContent, Select, MenuItem, FormControl, InputLabel } from '@mui/material';
import { useNavigate } from 'react-router-dom';

// Type des recettes
type Recipe = {
  name: string;
  description: string;
  ingredients: string[];
};

// Type des recettes par type de corps
type RecipePlan = {
  ectomorph: Recipe[];
  mesomorph: Recipe[];
  endomorph: Recipe[];
};

// Exemple de données pour les recettes
const recipes: RecipePlan = {
  ectomorph: [
    {
      name: 'Smoothie protéiné',
      description: 'Un smoothie riche en protéines pour prendre de la masse musculaire.',
      ingredients: ['200g de yaourt grec', '1 banane', '30g de protéines en poudre', '200ml de lait d’amande'],
    },
    {
      name: 'Pâtes au poulet',
      description: 'Un plat équilibré pour aider à la prise de poids.',
      ingredients: ['100g de pâtes complètes', '150g de poulet grillé', 'Brocolis', 'Huile d’olive'],
    },
  ],
  mesomorph: [
    {
      name: 'Salade de quinoa',
      description: 'Un repas équilibré riche en protéines et glucides pour maintenir un poids santé.',
      ingredients: ['100g de quinoa', '100g de poulet', 'Avocat', 'Tomates cerises', 'Feta'],
    },
    {
      name: 'Bowl de légumes et tofu',
      description: 'Un repas végétarien riche en protéines.',
      ingredients: ['Tofu', 'Épinards', 'Patate douce', 'Huile d’olive', 'Épices'],
    },
  ],
  endomorph: [
    {
      name: 'Soupe de légumes',
      description: 'Un plat faible en calories et riche en fibres pour favoriser la perte de poids.',
      ingredients: ['Courgettes', 'Carottes', 'Céleri', 'Oignons', 'Épices'],
    },
    {
      name: 'Salade d’épinards et saumon',
      description: 'Une salade légère et riche en oméga-3.',
      ingredients: ['Épinards', '150g de saumon', 'Avocat', 'Graines de chia', 'Vinaigrette légère'],
    },
  ],
};

const RecipeIdeas: React.FC = () => {
  const [bodyType, setBodyType] = useState<'ectomorph' | 'mesomorph' | 'endomorph'>('ectomorph');
  const navigate = useNavigate();

  const handleHomeClick = () => {
    navigate('/');
  };

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#000', // Fond noir
      color: '#fff', // Texte blanc
      display: 'flex', 
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center', 
      padding: '0', // Pas de padding en haut pour aligner correctement l'AppBar
    }}>
      {/* Ajout du bouton Home dans la barre d'en-tête */}
      <AppBar position="fixed" sx={{ backgroundColor: '#FF9800', width: '100%' }}>
        <Toolbar>
          <Button 
            variant="contained" 
            onClick={handleHomeClick} 
            sx={{ 
              backgroundColor: '#FF9800', 
              color: '#fff', 
              '&:hover': { backgroundColor: '#e68900' } 
            }}
          >
            Home
          </Button>
        </Toolbar>
      </AppBar>

      {/* Espacement pour que le contenu ne soit pas caché derrière l'AppBar */}
      <Toolbar />

      <Container 
        sx={{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#fff',
          padding: '20px',
          backgroundColor: 'rgba(255, 255, 255, 0.1)', // Légère transparence pour faire ressortir les éléments
          borderRadius: '10px',
          marginTop: '20px',
        }}
      >
        <Typography variant="h4" gutterBottom>
          Idées de recettes pour {bodyType.charAt(0).toUpperCase() + bodyType.slice(1)}
        </Typography>

        {/* Sélection du type de corps */}
        <FormControl fullWidth sx={{ marginBottom: '20px' }}>
          <InputLabel sx={{ color: '#fff' }}>Body Type</InputLabel>
          <Select
            value={bodyType}
            onChange={(e) => setBodyType(e.target.value as 'ectomorph' | 'mesomorph' | 'endomorph')}
            label="Body Type"
            sx={{ backgroundColor: 'rgba(192, 192, 192, 0.8)', borderRadius: '5px' }}
          >
            <MenuItem value="ectomorph">Ectomorph</MenuItem>
            <MenuItem value="mesomorph">Mesomorph</MenuItem>
            <MenuItem value="endomorph">Endomorph</MenuItem>
          </Select>
        </FormControl>

        <Grid container spacing={3}>
          {recipes[bodyType].map((recipe, index) => (
            <Grid item xs={12} sm={6} key={index}>
              <Card sx={{ backgroundColor: '#333' }}> {/* Cartes avec fond sombre */}
                <CardContent>
                  <Typography variant="h6" sx={{ color: '#fff' }}>{recipe.name}</Typography>
                  <Typography sx={{ color: '#ccc' }}>{recipe.description}</Typography>
                  <Typography sx={{ color: '#fff', marginTop: '10px' }}>Ingrédients:</Typography>
                  <ul>
                    {recipe.ingredients.map((ingredient, i) => (
                      <li key={i} style={{ color: '#ccc' }}>{ingredient}</li>
                    ))}
                  </ul>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

export default RecipeIdeas;
